import React, { useState } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  Switch,
  SafeAreaView,
  ScrollView,
  Alert,
} from 'react-native';
import { PanoramaViewer } from '../components/PanoramaViewer';

// Imagen de ejemplo en base64 (panorama equirectangular de prueba)
// Esta es una imagen pequeña de ejemplo - reemplaza con tu imagen base64
// Nota: Esta es una imagen 1x1 pixel para demostración. Para una prueba real,
// usa una imagen panorámica equirectangular real o la URL externa incluida.
const EXAMPLE_PANORAMA_BASE64 = `iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mNk+M9QDwADhgGAWjR9awAAAABJRU5ErkJggg==`;

// Si tienes una imagen real, pégala aquí:
const REAL_PANORAMA_BASE64 = `"`.trim();

export const Scene360TestScreen: React.FC = () => {
  const [useGyro, setUseGyro] = useState(true);
  const [currentImage, setCurrentImage] = useState<'example' | 'real' | 'url'>('example');
  const [showViewer, setShowViewer] = useState(false);

  const getImageSource = () => {
    switch (currentImage) {
      case 'example':
        return { base64: EXAMPLE_PANORAMA_BASE64 };
      case 'real':
        if (REAL_PANORAMA_BASE64 && REAL_PANORAMA_BASE64.length > 100) {
          return { base64: REAL_PANORAMA_BASE64 };
        } else {
          Alert.alert('Error', 'No hay imagen real configurada. Pega tu base64 en el código.');
          return { base64: EXAMPLE_PANORAMA_BASE64 };
        }
      case 'url':
        // Ejemplo de URL de panorama público - imagen equirectangular real
        return { uri: 'https://pannellum.org/images/cerro-toco-0.jpg' };
      default:
        return { base64: EXAMPLE_PANORAMA_BASE64 };
    }
  };

  const resetView = () => {
    setShowViewer(false);
  };

  const startTest = () => {
    setShowViewer(true);
  };

  if (showViewer) {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.viewerContainer}>
          <View style={styles.header}>
            <TouchableOpacity style={styles.backButton} onPress={resetView}>
              <Text style={styles.backButtonText}>← Volver</Text>
            </TouchableOpacity>
            
            <Text style={styles.headerTitle}>Prueba 360°</Text>
            
            <View style={styles.gyroToggle}>
              <Text style={styles.gyroLabel}>Giroscopio</Text>
              <Switch value={useGyro} onValueChange={setUseGyro} />
            </View>
          </View>

          <PanoramaViewer
            imageSource={getImageSource()}
            useGyro={useGyro}
            initialYaw={0}
            initialPitch={0}
          />

          <View style={styles.info}>
            <Text style={styles.infoText}>
              Modo: {currentImage === 'example' ? 'Imagen de Ejemplo' : 
                     currentImage === 'real' ? 'Imagen Real Base64' : 'URL Externa'}
            </Text>
            <Text style={styles.infoText}>
              Giroscopio: {useGyro ? 'ON - Mueve el dispositivo' : 'OFF - Usa drag táctil'}
            </Text>
          </View>
        </View>
      </SafeAreaView>
    );
  }

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.setupContainer}>
        <Text style={styles.title}>🌐 Prueba de Visor 360°</Text>
        <Text style={styles.subtitle}>
          Prueba la funcionalidad de panorama 360° con diferentes fuentes de imagen
        </Text>

        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Selecciona Fuente de Imagen:</Text>
          
          <TouchableOpacity
            style={[
              styles.optionButton,
              currentImage === 'example' && styles.optionButtonSelected
            ]}
            onPress={() => setCurrentImage('example')}
          >
            <Text style={[
              styles.optionText,
              currentImage === 'example' && styles.optionTextSelected
            ]}>
              🖼️ Imagen de Ejemplo (Base64)
            </Text>
            <Text style={styles.optionDescription}>
              Imagen pequeña de prueba incluida en el código
            </Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[
              styles.optionButton,
              currentImage === 'real' && styles.optionButtonSelected
            ]}
            onPress={() => setCurrentImage('real')}
          >
            <Text style={[
              styles.optionText,
              currentImage === 'real' && styles.optionTextSelected
            ]}>
              📸 Tu Imagen Real (Base64)
            </Text>
            <Text style={styles.optionDescription}>
              Pega tu imagen base64 en el código fuente
            </Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[
              styles.optionButton,
              currentImage === 'url' && styles.optionButtonSelected
            ]}
            onPress={() => setCurrentImage('url')}
          >
            <Text style={[
              styles.optionText,
              currentImage === 'url' && styles.optionTextSelected
            ]}>
              🌐 URL Externa
            </Text>
            <Text style={styles.optionDescription}>
              Imagen panorámica desde una URL pública
            </Text>
          </TouchableOpacity>
        </View>

        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Configuración:</Text>
          
          <View style={styles.switchContainer}>
            <Text style={styles.switchLabel}>Usar Giroscopio</Text>
            <Switch value={useGyro} onValueChange={setUseGyro} />
          </View>
          <Text style={styles.switchDescription}>
            {useGyro 
              ? '🧭 Mueve el dispositivo para controlar la vista' 
              : '👆 Usa gestos táctiles para navegar'
            }
          </Text>
        </View>

        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Instrucciones:</Text>
          <View style={styles.instructionsList}>
            <Text style={styles.instruction}>• Selecciona una fuente de imagen arriba</Text>
            <Text style={styles.instruction}>• Activa/desactiva el giroscopio según prefieras</Text>
            <Text style={styles.instruction}>• Presiona "Iniciar Prueba" para ver el panorama</Text>
            <Text style={styles.instruction}>• En el visor: usa los controles para zoom y centrar</Text>
            <Text style={styles.instruction}>• Si tienes problemas, automáticamente cambia a modo compatibilidad</Text>
          </View>
        </View>

        <TouchableOpacity
          style={styles.startButton}
          onPress={startTest}
        >
          <Text style={styles.startButtonText}>🚀 Iniciar Prueba 360°</Text>
        </TouchableOpacity>

        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Para usar tu propia imagen:</Text>
          <Text style={styles.codeInstruction}>
            1. Convierte tu imagen panorámica a base64{'\n'}
            2. Abre: src/screens/Scene360TestScreen.tsx{'\n'}
            3. Pega el base64 en la variable REAL_PANORAMA_BASE64{'\n'}
            4. Selecciona "Tu Imagen Real" y prueba
          </Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

